import React, { useState } from 'react'
import Select from './Select'

const state = {
  filters: {
    release_year: ""
  }
};

const onChangeFilters = event => {
  const name = event.target.name;
  const value = event.target.value;
  this.setState(state => ({
    filters: {
      ...state.filters,
      [name]: value
    }
  }));
};

function App() {
  const [filters, onChangeFilters] = setState('');
  return (
  <div className="App">
    <Select
      release_year={filters.release_year}
      onChangeFilters={onChangeFilters}
    />
    <p>Год выхода: {filters.release_year}</p>
  </div>
  )
}

export default App;
